export const GifExpertApp = () => {
  const categories = ["One Punch", "Samurai X", "Dragon Ball"];

  return (
    <>
      <h2>GifExpertApp</h2>
      <hr />
      <ol>
        {categories.map((category) => {
          return <li>category</li>;
        })}
      </ol>
    </>
  );
};
